from collections import deque

def nearestExit(maze, entrance):
    step = 0
    next_steps = deque([entrance])
    row_end, col_end = len(maze) - 1, len(maze[0]) - 1
    maze[entrance[0]][entrance[1]] = "+"
    while next_steps:
        cur_steps = next_steps
        next_steps = deque()
        while cur_steps:
            cur_x, cur_y = cur_steps.popleft()
            # mark the current position as visited
            if step != 0 and (cur_x == 0 or cur_x == row_end or cur_y == 0 or cur_y == col_end):
                return step
            if cur_x > 0 and maze[cur_x - 1][cur_y] == ".":
                next_steps.append([cur_x - 1, cur_y])
                maze[cur_x - 1][cur_y] = "+"
            if cur_x < row_end and maze[cur_x + 1][cur_y] == ".":
                next_steps.append([cur_x + 1, cur_y])
                maze[cur_x + 1][cur_y] = "+"
            if cur_y > 0 and maze[cur_x][cur_y - 1] == ".":
                next_steps.append([cur_x, cur_y - 1])
                maze[cur_x][cur_y - 1] = "+"
            if cur_y < col_end and maze[cur_x][cur_y + 1] == ".":
                next_steps.append([cur_x, cur_y + 1])
                maze[cur_x][cur_y + 1] = "+"
        step += 1
    return -1


